import{_ as t}from"./chunks/log_download.DNJj99t9.js";import{_ as o,c as a,a8 as r,o as i}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"비행 기록","description":"","frontmatter":{},"headers":[],"relativePath":"ko/getting_started/flight_reporting.md","filePath":"ko/getting_started/flight_reporting.md"}'),l={name:"ko/getting_started/flight_reporting.md"};function n(s,e,g,h,c,d){return i(),a("div",null,e[0]||(e[0]=[r('<h1 id="비행-기록" tabindex="-1">비행 기록 <a class="header-anchor" href="#비행-기록" aria-label="Permalink to &quot;비행 기록&quot;">​</a></h1><p>PX4는 성능 분석을 위하여 상세한 항공기 상태 데이터와 센서 데이터를 로그 파일에 기록합니다. 로그 파일 다운로드, 분석, 검토 및 개발 팀과 공유하는 방법을 설명합니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Keeping flight logs is a legal requirement in some jurisdictions.</p></div><h2 id="비행-콘트롤러에서-로그-다운로드" tabindex="-1">비행 콘트롤러에서 로그 다운로드 <a class="header-anchor" href="#비행-콘트롤러에서-로그-다운로드" aria-label="Permalink to &quot;비행 콘트롤러에서 로그 다운로드&quot;">​</a></h2><p>Logs can be downloaded using <a href="http://qgroundcontrol.com/" target="_blank" rel="noreferrer">QGroundControl</a>: <strong><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/analyze_view/log_download.html" target="_blank" rel="noreferrer">Analyze View &gt; Log Download</a></strong>.</p><p><img src="'+t+'" alt="Flight Log Download"></p><h2 id="로그-분석" tabindex="-1">로그 분석 <a class="header-anchor" href="#로그-분석" aria-label="Permalink to &quot;로그 분석&quot;">​</a></h2><p>Upload the log file to the online <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> tool. After upload you&#39;ll be emailed a link to the analysis page for the log.</p><p><a href="./../log/flight_review.html">Log Analysis using Flight Review</a> explains how to interpret the plots, and can help you to verify/reject the causes of common problems: excessive vibration, poor PID tuning, saturated controllers, imbalanced vehicles, GPS noise, etc.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>There are many other great tools for visualising and analysing PX4 Logs. For more information see: <a href="./../dev_log/flight_log_analysis.html">Flight Analysis</a>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If you have a constant high-rate MAVLink connection to the vehicle (not just a telemetry link) then you can use <em>QGroundControl</em> to automatically upload logs directly to <em>Flight Review</em>. For more information see <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/settings_view/mavlink.html#logging" target="_blank" rel="noreferrer">Settings &gt; MAVLink Settings &gt; MAVLink 2 Logging (PX4 only)</a>.</p></div><h2 id="px4-개발자가-검토할-로그-파일-공유" tabindex="-1">PX4 개발자가 검토할 로그 파일 공유 <a class="header-anchor" href="#px4-개발자가-검토할-로그-파일-공유" aria-label="Permalink to &quot;PX4 개발자가 검토할 로그 파일 공유&quot;">​</a></h2><p>The <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> log file link can be shared for discussion in the <a href="./../contribute/support.html#forums-and-chat">support forums</a> or a <a href="./../#reporting-bugs-issues">Github issue</a>.</p><h2 id="로그-설정" tabindex="-1">로그 설정 <a class="header-anchor" href="#로그-설정" aria-label="Permalink to &quot;로그 설정&quot;">​</a></h2><p>The logging system is configured by default to collect sensible logs for use with <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a>.</p><p>Logging may further be configured using the <a href="./../advanced_config/parameter_reference.html#sd-logging">SD Logging</a> parameters or with a file on the SD card. Details on configuration can be found in the <a href="./../dev_log/logging.html#configuration">logging configuration documentation</a>.</p><h2 id="주요-링크" tabindex="-1">주요 링크 <a class="header-anchor" href="#주요-링크" aria-label="Permalink to &quot;주요 링크&quot;">​</a></h2><ul><li><a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a></li><li><a href="./../log/flight_review.html">Log Analysis using Flight Review</a></li><li><a href="./../dev_log/flight_log_analysis.html">Flight Log Analysis</a></li></ul>',18)]))}const m=o(l,[["render",n]]);export{f as __pageData,m as default};
